E_D("replace into `www_92game_net_ecms_news` values('38','2','0','0','0','0','','38','1','admin','0','0','1','0','0','0','0','1475427801','1475427801','1','0','0','','/word/shehuibaitai/38.html','1','1','1','','男子开车过深水河 众人不禁捏汗','1442299828','/d/file/titlepic/2016/10/03/hgkq4vnmpv5.jpg','','近日，外国有两名男子竟开车过深水河。两人开车过深水河的视频在网上走红，然而，这两名男子却被网友评作“愚蠢至极”。图片中可以看到，汽车开至河中间的时候，车内已经灌满水，整个车身已几乎被淹没。','0','http://www.27270.com/word/shehuibaitai/2015/133629.html','');");
E_D("replace into `www_92game_net_ecms_news` values('39','2','0','0','0','0','','39','1','admin','0','0','1','0','0','0','0','1475427802','1475427802','1','0','0','','/word/shehuibaitai/39.html','1','1','1','','服刑犯狱中网络诈骗百万 揭秘他是怎么做到的?','1442046736','/d/file/titlepic/2016/10/03/yjt2hjwyn0o.jpg','','据媒体报道，一名正在监狱服刑的在押犯人，通过电话、微信、支付宝等工具，以代买足球彩票、“足彩刷返利”等手段，诈骗数十人，金额超百万元。','0','http://www.27270.com/word/shehuibaitai/2015/133562.html','');");
E_D("replace into `www_92game_net_ecms_news` values('40','2','0','4','0','0','','40','1','admin','0','0','1','0','0','0','0','1475427802','1475427802','1','0','0','','/word/shehuibaitai/40.html','1','1','1','','中科大学霸尹希31岁成哈佛正教授 破华人记录','1442630160','/d/file/titlepic/2016/10/03/3oatzgekn5j.jpg','','9月初，美国哈佛大学物理系网页上发布了一条一句话消息“尹希晋升到正教授”，这短短一句话背后的信息量可大得很。首先，本科毕业于中国科技大学少年班的尹希很年轻，1983年12月出生的他今年还未满32岁。','0','http://www.27270.com/word/shehuibaitai/2015/133893.html','');");
E_D("replace into `www_92game_net_ecms_news` values('41','6','0','0','0','0','','41','1','admin','0','0','1','0','0','0','0','1475430923','1475430923','1','0','0','','/word/chebiao/41.html','1','1','1','','Smart','1475429511','/d/file/titlepic/2016/10/03/vcqzulza31j.jpg','','　　smart是德国梅赛德斯-奔驰与手表巨头瑞士Swatch公司合作的产物。名称中的S代表了斯沃奇，M代表了梅赛德斯-奔驰，art意为艺术，代表了双方合作的艺术性;而smart本身就有聪明伶俐的含义，也与其品牌理念相契合。现代都市中车辆愈来愈多，为应对这个问题，许多汽车制造商陆续提出微型都市代步用车的概念。而由Swatch开发的smart也不例外，加上奔驰的技术支持，让smart得以保留概念车的创意，同时兼具了流行及实用等优点。小巧的造型，配合智能化及人性化的操控设计，令smart的车型如同一部聪明的大玩','0','http://www.27270.com/word/chebiao/2015/7720.html','');");
E_D("replace into `www_92game_net_ecms_news` values('42','6','0','0','0','0','','42','1','admin','0','0','1','0','0','0','0','1475430924','1475430924','1','0','0','','/word/chebiao/42.html','1','1','1','','布加迪','1475429512','/d/file/titlepic/2016/10/03/wstr2ercgyo.jpg','','　　布加迪在赛车的成就很高，在几十年内就获得无数冠军。Bugatti Type 10在第一次赛事上就赢得前四名。在1924年的Bugatti Type 35可谓布加迪史上最成功的赛车，它横扫车坛，共赢得2000个大小不等的冠军。布加迪赢得Targa Florio赛事1925年到1929年的冠军.Louis Chiron是驾驶布加迪赛车登上最多次颁奖台的车手，在日后规划大众集团的布加迪为纪念他推出了以他为名的概念车。<br />\n\n　　布加迪最后的成就是1939年利曼24小时耐久赛的冠军由Jean-Pier','0','http://www.27270.com/word/chebiao/2015/8091.html','');");
E_D("replace into `www_92game_net_ecms_news` values('43','6','0','0','0','0','','43','1','admin','0','0','1','0','0','0','0','1475430924','1475430924','1','0','0','','/word/chebiao/43.html','1','1','1','','吉普','1475429513','/d/file/titlepic/2016/10/03/ivhhacrvqvn.jpg','','　　20世纪30年代末，战争在欧洲打起。美国无可避免地加入了第二次世界大战。早在第一次世界大战时，美国军方就寻找一种快速、轻型、全地形越野车(载重1/4吨)，作一般用途(包括侦察、少量载货等)。在1940年，随着欧洲和北非战事的发展，这种需求变得愈发急迫。1940年6月，美国陆军开始向各汽车厂招标，期限是49天。<br />\n\n　　49天的期限实在太短，各大车厂望而却步。同年七月底截标时，只有三家公司对军方的招标作出反应，它们是班谭(Bantam)、福特和威利斯。班谭在竞争中走在前面，他们最早拿出整体设计','0','http://www.27270.com/word/chebiao/2015/8107.html','');");
E_D("replace into `www_92game_net_ecms_news` values('44','6','0','0','0','0','','44','1','admin','0','0','1','0','0','0','0','1475430925','1475430925','1','0','0','','/word/chebiao/44.html','1','1','1','','奥迪','1475429512','/d/file/titlepic/2016/10/03/hukbaaytqzx.jpg','','　　奥迪(Audi)是德国大众汽车集团子公司奥迪汽车公司旗下的豪华汽车品牌，作为高技术水平、质量标准、创新能力、以及经典车型款式的代表，奥迪是世界最成功的汽车品牌之一。公司总部设在德国的英戈尔施塔特，并在中国等许多国家有分工公司。','0','http://www.27270.com/word/chebiao/2015/7729.html','');");
E_D("replace into `www_92game_net_ecms_news` values('45','6','0','0','0','0','','45','1','admin','0','0','1','0','0','0','0','1475430926','1475430926','1','0','0','','/word/chebiao/45.html','1','1','1','','标致','1475429513','/d/file/titlepic/2016/10/03/lf5wbwgfojc.jpg','','　　标致是法国标致雪铁龙集团子公司标致汽车公司旗下汽车品牌，标致汽车公司是欧洲老牌的汽车生产企业。标致品牌在全球160个国家建立了销售网络，拥有1万家销售网点。标致汽车集卓越、魅力和情感于一身，行驶在世界的每个角落。然而制造汽车并不是标致的全部历史。标致曾涉足制造业的诸多领域，比如五金工具、家用器皿、裙撑、望远镜、夹鼻眼镜弹簧、锯条、外科手术器械、猎枪、收音机、缝纫机、不一而足。<br />\n\n　　在汽车时代来临之前，标致自行车、摩托车和运输车辆的生产规模一度相当庞大。毕竟，标致的历史可以上溯到十五世纪，','0','http://www.27270.com/word/chebiao/2015/8090.html','');");
E_D("replace into `www_92game_net_ecms_news` values('46','6','0','0','0','0','','46','1','admin','0','0','1','0','0','0','0','1475430926','1475430926','1','0','0','','/word/chebiao/46.html','1','1','1','','林肯','1475429513','/d/file/titlepic/2016/10/03/tkxv312xt25.jpg','','　　美国著名汽车企业福特公司旗下的一个豪华车品牌，创立于1917年，创始人为亨利·利兰。其品牌名称是以美国总统亚伯拉罕·林肯的名字命名。自1939年美国总统富兰克林·罗斯福以来，由于林肯车杰出的性能、典雅的造型和无与伦比的舒适一直被白宫选为总统专车。它最\\\\\"出名\\\\\"的一款车是肯尼迪总统乘用的检阅车。林肯品牌著名的产品有：MKC、MKZ、\\\\\"大陆\\\\\"(Continental)、\\\\\"马克八世(MarkⅧ)、\\\\\"城市\\\\\"(TownCar)和\\\\\"领航员\\\\\" (Navigator)等在中国使用的林肯轿车多为\\\\\"城市','0','http://www.27270.com/word/chebiao/2015/8109.html','');");
E_D("replace into `www_92game_net_ecms_news` values('47','6','0','0','0','0','','47','1','admin','0','0','1','0','0','0','0','1475430926','1475430926','1','0','0','','/word/chebiao/47.html','1','1','1','','宝马','1475429513','/d/file/titlepic/2016/10/03/uwhzthlk4uj.jpg','','　　宝马德系三大豪华品牌之一，宝马的车系有1、2、3、4、5、6、7、i、X、Z、等几个系列，还有在各系基础上进行改进的M系(宝马官方的高性能改装部门)。<br />\n\n　　宝马公司创建于1916年，总部设在德国慕尼黑。<br />\n\n　　BMW的蓝白标志宝马总部所在地巴伐利亚州州旗的颜色。百年来，宝马汽车由最初的一家飞机引擎生产厂发展成为以高级轿车为主导，并生产享誉全球的飞机引擎、越野车和摩托车的企业集团，名列世界汽车公司前列。宝马也被译为“巴依尔”。<br />\n\n　　2016年3月7日 ，宝马与百度','0','http://www.27270.com/word/chebiao/2015/7736.html','');");
E_D("replace into `www_92game_net_ecms_news` values('48','6','0','0','0','0','','48','1','admin','0','0','1','0','0','0','0','1475430927','1475430927','1','0','0','','/word/chebiao/48.html','1','1','1','','世爵','1475429514','/d/file/titlepic/2016/10/03/ouiu3csj25q.jpg','','世爵作为历史超过百年的老厂，一直保持着品牌独特的风格。他们生产的跑车全部为手工打造，多项指标采用F1标准。作为知名的极品豪华运动汽车制造商，世爵制造的贵族运动汽车完全依据客户的需求量身定制。世爵的目标是运动汽车市场的最高端的用户，这些客户主要集中在美国、西欧、中东以及一些较小的富裕的国家，比如说瑞士和摩纳哥等等。2014年12月18日，世爵发布声明宣布破产。2015年世爵首席执行官Victor Muller在一份声明中表示，世爵目前已经偿清债务，正在准备和电动飞机制造商Volta Volare进行合并，将','0','http://www.27270.com/word/chebiao/2015/8766.html','');");
E_D("replace into `www_92game_net_ecms_news` values('49','6','0','0','0','0','','49','1','admin','0','0','1','0','0','0','0','1475430928','1475430928','1','0','0','','/word/chebiao/49.html','1','1','1','','克莱斯勒','1475429514','/d/file/titlepic/2016/10/03/aewr5jxnddd.jpg','','　　克莱斯勒(香港译名：佳士拿)，是美国著名汽车公司，同时也是美国三大汽车公司之一。克莱斯勒18英寸轮毂配合米其林Pilot运动型轮胎使操控性进一步提高。<br />\n\n　　该公司创始人为沃尔特·克莱斯勒(Walter Chrysler)，1875年出生于美国堪萨斯州，父母都是当地小有名气的作家。<br />\n\n　　2014年9月，克莱斯勒因价格垄断被上海物价局处罚3168.2万元。<br />\n\n　　2014年12月16日，克莱斯勒改名为FCA美国。','0','http://www.27270.com/word/chebiao/2015/8110.html','');");
E_D("replace into `www_92game_net_ecms_news` values('50','6','0','0','0','0','','50','1','admin','0','0','1','0','0','0','0','1475430928','1475430928','1','0','0','','/word/chebiao/50.html','1','1','1','','保时捷','1475429514','/d/file/titlepic/2016/10/03/wu4oxhaoyhw.jpg','','　　保时捷(Porsche)，又叫波尔舍，是欧美汽车(omeiche)的主要代表，也是闻名世界的汽车公司。1931年成立于斯图加特，以生产高级跑车闻名于世界车坛。创始人费迪南德·波尔舍(同费迪南德·保时捷)是一位享誉世界车坛的著名设计师。<br />\n\n　　保时捷汽车主要车型有911、Boxster、Cayman、Panamera、Cayenne、Macan。','0','http://www.27270.com/word/chebiao/2015/7739.html','');");
E_D("replace into `www_92game_net_ecms_news` values('51','6','0','0','0','0','','51','1','admin','0','0','1','0','0','0','0','1475430930','1475430930','1','0','0','','/word/chebiao/51.html','1','1','1','','英菲尼迪','1475429515','/d/file/titlepic/2016/10/03/ru31yy1afny.jpg','','　　英菲尼迪(Infiniti)是日产汽车公司旗下的豪华车品牌，于1989年诞生于北美地区。凭借独特前卫的设计、出色的产品性能和贴心的客户服务，英菲尼迪迅速成为全球豪华汽车市场中最重要的品牌之一。<br />\n\n　　英菲尼迪于当年11月8日最先在美国上市，上市的车型包括高性能豪华轿车Infiniti Q45和充满操控乐趣的豪华双门跑车Infiniti M30。与雷克萨斯、宝马、奔驰在北美市场分庭抗礼，并且迅速成长为北美重要的豪华车品牌。自诞生之日起，英菲尼迪便以独特前卫的设计、出色的操控表现和顶级的客户服','0','http://www.27270.com/word/chebiao/2015/8221.html','');");
E_D("replace into `www_92game_net_ecms_news` values('52','6','0','0','0','0','','52','1','admin','0','0','1','0','0','0','0','1475430930','1475430930','1','0','0','','/word/chebiao/52.html','1','1','1','','奔驰','1475429515','/d/file/titlepic/2016/10/03/zpo522iov1y.jpg','','　　奔驰，德国汽车品牌，被认为是世界上最成功的高档汽车品牌之一，其完美的技术水平、过硬的质量标准、推陈出新的创新能力、以及一系列经典轿跑车款式令人称道。奔驰三叉星已成为世界上最著名的汽车及品牌标志之一。','0','http://www.27270.com/word/chebiao/2015/7742.html','');");
E_D("replace into `www_92game_net_ecms_news` values('53','6','0','0','0','0','','53','1','admin','0','0','1','0','0','0','0','1475430930','1475430930','1','0','0','','/word/chebiao/53.html','1','1','1','','雷克萨斯','1475429515','/d/file/titlepic/2016/10/03/dqfbxr1vcmq.jpg','','　　雷克萨斯(LEXUS)是日本丰田集团旗下全球著名豪华汽车品牌。创立于1983年，仅仅用了十几年的时间，在北美便超过了奔驰、宝马的销量。1999年起至今，其连续11年位居美国豪华汽车销量第一的宝座。雷克萨斯(英语：Lexus，日语：レクサス)是日本丰田汽车旗下于北美、欧洲、亚洲、中东、拉丁美洲、非洲、大洋洲等地销售的独立高级轿车品牌。2005年，雷克萨斯打入日本本土市场，成为在全球均有销售的高级轿车品牌。初时雷克萨斯在美国国内以“热切追求完美”(The Passionate Pursuit of Per','0','http://www.27270.com/word/chebiao/2015/8165.html','');");
E_D("replace into `www_92game_net_ecms_news` values('54','6','0','0','0','0','','54','1','admin','0','0','1','0','0','0','0','1475430932','1475430932','1','0','0','','/word/chebiao/54.html','1','1','1','','大众','1475429515','/d/file/titlepic/2016/10/03/23uswip44s2.jpg','','　　大众汽车(德语：Volkswagen)是一家总部位于德国沃尔夫斯堡的汽车制造公司，也是世界四大汽车生产商之一的大众集团的核心企业。2016年位居《财富》世界500强第7位。<br />\n\n　　Volks在德语中意思为“国民”，Wagen在德语中意思为“汽车”，全名的意思即“国民的汽车”，故又常简称为“VW”。台湾译为福斯汽车，港澳、大陆译为大众汽车或福士汽车，意思是“人民的汽车”。整个汽车集团在2012年产销超过907万辆，大众品牌则超过574万辆。','0','http://www.27270.com/word/chebiao/2015/7744.html','');");
E_D("replace into `www_92game_net_ecms_news` values('55','6','0','0','0','0','','55','1','admin','0','0','1','0','0','0','0','1475430933','1475430933','1','0','0','','/word/chebiao/55.html','1','1','1','','别克','1475429516','/d/file/titlepic/2016/10/03/znlqiwgcc4u.jpg','','　　别克(BUICK)商标中那形似“三颗子弹”的图案为其图形商标，它是别克分部的标志。它被安装在汽车散热器格栅上。图中那三颗颜色不同(从左到右：红、白、蓝三种颜色)并依次排列在不同高度位置上的子弹，给人一种积极进取、不断攀登的感觉;它表示别克分部采用顶级技术，刃刃见锋;也表示别克分部培养的人才个个游刃有余，是无坚不摧、勇于登峰的勇士。自2002年起，别克(BUICK)的商标更换为简洁的形式。<br />\n\n　　别克著名的“三盾”标志是以一个圆圈中包含三个盾为基本图案。它的由来可以直接追溯到汽车制造业的奠基','0','http://www.27270.com/word/chebiao/2015/8094.html','');");
E_D("replace into `www_92game_net_ecms_news` values('56','6','0','0','0','0','','56','1','admin','0','0','1','0','0','0','0','1475430933','1475430933','1','0','0','','/word/chebiao/56.html','1','1','1','','本田','1475429516','/d/file/titlepic/2016/10/03/5z3fesyigrd.jpg','','　　本田株式会社(本田技研工业株式会社)是世界上最大的摩托车生产厂家，汽车产量和规模也名列世界十大汽车厂家之列。1948年创立，创始人是传奇式人物本田宗一郎。公司总部在东京，雇员总数达18万人左右。现在，本田公司已是一个跨国汽车、摩托车生产销售集团。它的产品除汽车、摩托车外，还有发电机、农机等动力机械产品。','0','http://www.27270.com/word/chebiao/2015/8111.html','');");
E_D("replace into `www_92game_net_ecms_news` values('57','6','0','0','0','0','','57','1','admin','0','0','1','0','0','0','0','1475430934','1475430934','1','0','0','','/word/chebiao/57.html','1','1','1','','欧宝','1475429516','/d/file/titlepic/2016/10/03/dwjmuhayv05.jpg','','　　OPEL在中国大陆称为欧宝、在台湾称为欧普。德国欧宝公司是美国通用汽车公司的子公司，是通用公司在欧洲的一个窗口。它由Adam Opel，即亚当·欧宝(欧普)所创立，至今已有百多年历史。欧宝自1993年进入中国。目前已停止在中国销售。','0','http://www.27270.com/word/chebiao/2015/7748.html','');");
E_D("replace into `www_92game_net_ecms_news` values('58','6','0','0','0','0','','58','1','admin','0','0','1','0','0','0','0','1475430934','1475430934','1','0','0','','/word/chebiao/58.html','1','1','1','','GMC','1475429516','/d/file/titlepic/2016/10/03/u5jzfsxqpmd.jpg','','　　GMC“商务之星”是一款纯为商务人士打造的豪华型商务旅行车。车头宽大的前脸十字星车标和四个高承铝合金锻造轮毂，在阳光下熠熠生辉，配以5.7m/6.2m长、2.4m高、2m宽的宽大车身设计，一派豪华、大气的纯正美式风格已跃然映入眼帘。','0','http://www.27270.com/word/chebiao/2015/8095.html','');");
E_D("replace into `www_92game_net_ecms_news` values('59','6','0','0','0','0','','59','1','admin','0','0','1','0','0','0','0','1475430935','1475430935','1','0','0','','/word/chebiao/59.html','1','1','1','','讴歌','1475429517','/d/file/titlepic/2016/10/03/ukmzufmklmo.jpg','','　　讴歌(Acura)是日本本田汽车公司旗下的高端子品牌，于1986年在美国创立，其名称Acura源于拉丁语Accuracy(精确)，标志为一个用于工程测量的卡钳形象，反映出讴歌精湛的造车工艺与追求完美的理念。作为第一个日系豪华汽车品牌，讴歌以个性化和前瞻科技的“运动豪华”理念对豪华车的概念进行了重新诠释，品牌一经推出即在北美市场获得了巨大的成功。讴歌的车型均在北美进行设计、开发和生产，先后开发出了以TL、RL、MDX等车型为首的丰富产品线。讴歌品牌于2006年9月27日正式登陆中国市场。','0','http://www.27270.com/word/chebiao/2015/8166.html','');");
E_D("replace into `www_92game_net_ecms_news` values('60','6','0','0','0','0','','60','1','admin','0','0','1','0','0','0','0','1475430936','1475430936','1','0','0','','/word/chebiao/60.html','1','1','1','','迈巴赫','1475429517','/d/file/titlepic/2016/10/03/lxd5j2v505b.jpg','','　　滕飞(德文：Maybach)与迈巴赫引擎制造厂(德文：Maybach-Motorenbau GmbH)是一曾经在1921年到1940年间活跃于欧洲地区的德国超豪华汽车品牌与制造厂，车厂创始人卡尔·迈巴赫(Karl Maybach)的父亲威廉·迈巴赫(Wilhelm Maybach)曾担任戴姆勒发动机公司(今日戴姆勒集团前身)的首席技术总监，两厂渊源甚深。1997年戴姆勒·克莱斯勒集团在东京车展会场中展出一辆以Maybach为名的概念性超豪华四门轿车，正式让这个德国汽车品牌在销声匿迹多年后再次复活。<b','0','http://www.27270.com/word/chebiao/2015/7746.html','');");
E_D("replace into `www_92game_net_ecms_news` values('61','6','0','0','0','0','','61','1','admin','0','0','1','0','0','0','0','1475430936','1475430936','1','0','0','','/word/chebiao/61.html','1','1','1','','Rossion','1475429517','/d/file/titlepic/2016/10/03/bwhkaa10igl.jpg','','　　Rossion汽车(罗森汽车)公司的总部设在佛罗里达州的庞帕诺海滩，是一家2000年后成立的汽车公司。该公司创造了新型的Q1跑车。作为一家新型汽车公司，Rossion致力于在车辆的设计当中实现最纯粹的性能、速度和平衡处理形式。在2010年，Rossion汽车公司把Rossion品牌扩展到全球各地。Rossion汽车公司由两位合作伙伴伊安·格伦内斯和迪恩·罗森共同创立。','0','http://www.27270.com/word/chebiao/2015/8096.html','');");
E_D("replace into `www_92game_net_ecms_news` values('62','6','0','0','0','0','','62','1','admin','0','0','1','0','0','0','0','1475430937','1475430937','1','0','0','','/word/chebiao/62.html','1','1','1','','日产','1475429518','/d/file/titlepic/2016/10/03/lmzbcqv2tqw.jpg','','　　日产(NISSAN )，是日本的一家汽车制造商，由鲇川义介(Aikawa Yoshisuke)于1933年在神奈川县横滨市成立，目前在二十个国家和地区(包括日本)设有汽车制造基地，并在全球160多个国家和地区提供产品和服务。公司经营范围包括汽车产品和船舶设备的制造、销售和相关业务，现任总裁兼首席执行官为卡洛斯·戈恩(Carlos Ghosn)。1999年，雷诺与日产汽车结成独立的合作伙伴关系，在广泛的领域中展开战略性的合作，日产汽车通过联盟将事业区域拓展至全球，其经济规模大幅增长。<br />\n\n　　','0','http://www.27270.com/word/chebiao/2015/8174.html','');");
E_D("replace into `www_92game_net_ecms_news` values('63','6','0','0','0','0','','63','1','admin','0','0','1','0','0','0','0','1475430937','1475430937','1','0','0','','/word/chebiao/63.html','1','1','1','','雪铁龙','1475429518','/d/file/titlepic/2016/10/03/luz5jhtmuhr.jpg','','　　1912年，他开办了“V形齿轮厂”，当时他生产了一批双螺旋齿轮。<br />\n\n　　第一次世界大战期间，雪铁龙应征担任炮兵队长。当他发现弹药不足时，主动请缨组建工厂生产炮弹。在这里，他的组织管理才能得到了极大的发挥，不仅使炮弹日产量创下5万枚的纪录，而且由于组织得当，使妇女也可参与工作，从而让更多的男人可以抽身参战。<br />\n\n　　战后，安德鲁审时度势从亨利·福特的成功看到家庭汽车的未来，并于1919年建造以自己名字命名的汽车工厂“CITROEN”就是为了纪念当年的齿轮厂。安德鲁精心打造雪铁龙这个','0','http://www.27270.com/word/chebiao/2015/8092.html','');");
E_D("replace into `www_92game_net_ecms_news` values('64','6','0','0','0','0','','64','1','admin','0','0','1','0','0','0','0','1475430938','1475430938','1','0','0','','/word/chebiao/64.html','1','1','1','','道奇','1475429518','/d/file/titlepic/2016/10/03/p3ofybp4cbz.jpg','','　　“道奇”是汽车品牌，总部设在美国。商标采用道奇兄弟的姓氏“Dodge”，图形商标是在一个五边形中有一羊头形象，在汽车上使用小公羊、大公羊两个商标。<br />\n\n　　道奇旗下的汽车产品一直在各个时代引领甚至代表了全球主流的人文精神，不断进取，向往自由并追求乐活的生活态度。','0','http://www.27270.com/word/chebiao/2015/8104.html','');");
E_D("replace into `www_92game_net_ecms_news` values('65','6','0','0','0','0','','65','1','admin','0','0','1','0','0','0','0','1475430938','1475430938','1','0','0','','/word/chebiao/65.html','1','1','1','','斯巴鲁','1475429518','/d/file/titlepic/2016/10/03/pza22dp0zvw.jpg','','　　斯巴鲁(片假名：スバル;罗马拼音：Subaru)，台湾地区译作速霸陆，是一家日本汽车制造商 ，是属于富士重工( FHI )汽车部门的企业。<br />\n\n　　斯巴鲁在日语中的意思是“昴(すばる)”，其企业标志是昴宿星团的六连星(昴宿为按照中国古代的星座划分方法的星座名称)，并且也是斯巴鲁汽车的标志。斯巴鲁的标志代表着五个独立的公司一起组成了现今的斯巴鲁。斯巴鲁汽车拥有独特的技术，尤其是水平对卧式引擎和全时四轮驱动系统。斯巴鲁近年来业绩显著，2006年全球销售创下其历史记录。富士重工一直开发具有独特性的','0','http://www.27270.com/word/chebiao/2015/8225.html','');");
E_D("replace into `www_92game_net_ecms_news` values('66','6','0','0','0','0','','66','1','admin','0','0','1','0','0','0','0','1475430939','1475430939','1','0','0','','/word/chebiao/66.html','1','1','1','','福特','1475429519','/d/file/titlepic/2016/10/03/hwdgpfvo54c.jpg','','　　福特(Ford)是世界著名的汽车品牌，为美国福特汽车公司(Ford Motor Company)旗下的众多品牌之一，公司及品牌名“福特”来源于创始人亨利·福特(Henry Ford)的姓氏。福特汽车公司是世界上最大的汽车生产商之一，成立于1903年，旗下拥有福特(Ford)和林肯(Lincoln)汽车品牌，总部位于密歇根州 迪尔伯恩市(Dearborn)。<br />\n\n　　福特汽车的标志是采用福特英文Ford字样，蓝底白字。由于创建人亨利·福特喜欢小动物，所以标志设计者把福特的英文画成一只小白兔样子','0','http://www.27270.com/word/chebiao/2015/8105.html','');");
E_D("replace into `www_92game_net_ecms_news` values('67','6','0','0','0','0','','67','1','admin','0','0','1','0','0','0','0','1475430939','1475430939','1','0','0','','/word/chebiao/67.html','1','1','1','','雷诺','1475429519','/d/file/titlepic/2016/10/03/psnbrjml2qm.jpg','','　　雷诺，(Renault S.A.)是一家法国车辆制造商，生产的车辆种类有赛车、小型车、中型车、休旅车、大型车(包含卡车和工程用车及巴士)等。雷诺第一次进入美国市场销售是1950年代及1960年代之间。','0','http://www.27270.com/word/chebiao/2015/8093.html','');");
E_D("replace into `www_92game_net_ecms_news` values('68','6','0','0','0','0','','68','1','admin','0','0','1','0','0','0','0','1475430940','1475430940','1','0','0','','/word/chebiao/68.html','1','1','1','','马自达','1475429519','/d/file/titlepic/2016/10/03/1gsi1fbgvqq.jpg','','　　马自达(MAZDA)，是一家日本的汽车制造商，总部设在日本广岛，主要销售市场包括亚洲、欧洲和北美洲。MAZDA是日本最著名的汽车品牌之一，日本第四大汽车制造商，是世界著名汽车品牌，是世界上唯一研发和生产转子发动机的汽车公司。2008年《财富》全球500强企业排名中名列第二百五十五位。<br />\n\n　　马自达公司创立于1920年，1931年正式开始在广岛生产小型载货车，60年代初正式生产轿车，自1981年到2002年，马自达已累积生产了3,500多万辆各种汽车。在九十年代之前，马自达汽车公司在日本国内','0','http://www.27270.com/word/chebiao/2015/8169.html','');");
E_D("replace into `www_92game_net_ecms_news` values('69','6','0','0','0','0','','69','1','admin','0','0','1','0','0','0','0','1475430941','1475430941','1','0','0','','/word/chebiao/69.html','1','1','1','','悍马','1475429520','/d/file/titlepic/2016/10/03/pijrh5jl0t0.jpg','','　　美国AMG公司以生产悍马(Hummer)而扬名世界。AMG公司的创始人乌特是一位自行车制造商，1903年成立越野(Overland)汽车部。1908年，约翰·威利购买了越野汽车部，并于1912年成立威利斯-越野(Willys-Overland)汽车公司，生产威利-骑士汽车。2009年，腾中重工从通用手中收购悍马以失败告终。','0','http://www.27270.com/word/chebiao/2015/8106.html','');");
E_D("replace into `www_92game_net_ecms_news` values('70','6','0','0','0','0','','70','1','admin','0','0','1','0','0','0','0','1475430942','1475430942','1','0','0','','/word/chebiao/70.html','1','1','1','','三菱','1475429519','/d/file/titlepic/2016/10/03/dkm2dgqvesd.jpg','','　　三菱集团(Mitsubishi Group)是由原先日本三菱财阀解体后的公司共同组成的一个松散的实体，Mitsubishi这个名字中的mitsu表示“三”，而bishi表示“菱角”。第一家三菱企业是岩崎弥太郎于1870年(庚午年)接手官方经营的长崎造船厂，1873年造船厂更名为三菱商会。接着三菱开始涉足采矿、造船、银行、保险、仓储和贸易，随后又经营纸、钢铁、玻璃、电气设备、飞机、石油和房地产。现在三菱已建立起一系列的企业，在日本工业现代化的过程中扮演着举足轻重的角色。<br />\n\n　　2016年6月','0','http://www.27270.com/word/chebiao/2015/8179.html','');");
E_D("replace into `www_92game_net_ecms_news` values('71','6','0','0','0','0','','71','1','admin','0','0','1','0','0','0','0','1475430942','1475430942','1','0','0','','/word/chebiao/71.html','1','1','1','','光冈','1475429520','/d/file/titlepic/2016/10/03/ha35smeafol.jpg','','　　光冈成立于1968年，是日本汽车品牌，主要生产改装轿车。','0','http://www.27270.com/word/chebiao/2015/8163.html','');");
E_D("replace into `www_92game_net_ecms_news` values('72','6','0','0','0','0','','72','1','admin','0','0','1','0','0','0','0','1475430943','1475430943','1','0','0','','/word/chebiao/72.html','1','1','1','','mini','1475429521','/d/file/titlepic/2016/10/03/0eabkk4euhi.jpg','','　　Mini是由英国汽车公司推出后被宝马公司持有的一款汽车品牌，该汽车品牌是一款风靡全球、个性十足的小型两厢车，1959年8月26日由英国汽车公司(BMC)推出，在半个多世纪的历史里，Mini获得了巨大的成功。2000年旧款Mini停止生产，Mini品牌的新持有者宝马(BMW)宣布推出Mini的继承车款，并将新车的品牌定为MINI(全为大写英文字母)。','0','http://www.27270.com/word/chebiao/2015/8045.html','');");
E_D("replace into `www_92game_net_ecms_news` values('73','6','0','0','0','0','','73','1','admin','0','0','1','0','0','0','0','1475430943','1475430943','1','0','0','','/word/chebiao/73.html','1','1','1','','柯尼塞格','1475429520','/d/file/titlepic/2016/10/03/rmkshwuxadr.jpg','','　　Koenigsegg一词是“刀锋”的意思，在国内曾被翻译为“柯尼赛格”，是瑞典一家汽车公司。它的标志是瑞典皇空军的标志，为一幽灵图!所以有“幽灵跑车”之称。1994年，瑞典一群有汽车工业经验和专业知识的优秀设计师和工程师，以克瑞汀·凡·科尼塞格的名字，在瑞典南部安吉荷姆附近成立了这家汽车厂。','0','http://www.27270.com/word/chebiao/2015/8253.html','');");
E_D("replace into `www_92game_net_ecms_news` values('74','6','0','0','0','0','','74','1','admin','0','0','1','0','0','0','0','1475430945','1475430945','1','0','0','','/word/chebiao/74.html','1','1','1','','宾利','1475429522','/d/file/titlepic/2016/10/03/g2xzybcogjm.jpg','','　　宾利汽车公司(BentleyMotors Limited)是举世闻名的超豪华汽车制造商，总部位于英国克鲁。1919年，W.O.宾利先生创办了宾利汽车公司。近一个世纪之后，宾利先生的理念仍继续指引着我们的信念、行动和宏大目标。宾利汽车历久弥新，熠熠生辉顶级英国豪华汽车之列，手工打造全世界最佳性能的豪华旅行轿车，宾利在1997年被大众集团收购。','0','http://www.27270.com/word/chebiao/2015/8046.html','');");
E_D("replace into `www_92game_net_ecms_news` values('75','6','0','0','0','0','','75','1','admin','0','0','1','0','0','0','0','1475430945','1475430945','1','0','0','','/word/chebiao/75.html','1','1','1','','西雅特','1475429521','/d/file/titlepic/2016/10/03/mw2yj350qru.jpg','','　　西雅特(Seat)是西班牙最大的汽车公司，1950年成立于巴塞罗那。现在属于德国大众汽车公司子公司。西雅特汽车公司成立之初，以生产意菲亚特汽车公司的车型为主，在西班牙汽车市场占有率曾达到60%，到70年代其市场占有率下降到33%，亏损严重。1983年德国大众汽车公司买下了西雅特的大部分股份，与另一合资者——西班牙政府共同经营西雅特汽车公司，使西雅特属于大众汽车公司的子公司。西雅特归属大众麾下后，得到大众资金与技术的支持，它采用大众的零部件，有些车型的底盘、转向及悬挂系统由大众设计。经营状态日趋好转，到','0','http://www.27270.com/word/chebiao/2015/8764.html','');");
E_D("replace into `www_92game_net_ecms_news` values('76','6','0','0','0','0','','76','1','admin','0','0','1','0','0','0','0','1475430947','1475430947','1','0','0','','/word/chebiao/76.html','1','1','1','','捷豹','1475429522','/d/file/titlepic/2016/10/03/nvgxgsqqvjk.jpg','','　　捷豹(Jaguar)：是英国的一家豪华汽车生产商，车标为一只正在跳跃前扑的“美洲豹”形象，矫健勇猛，形神兼备，具有时代感与视觉冲击力，它既代表了公司的名称，又表现出向前奔驰的力量与速度，象征该车如美洲豹一样驰骋于世界各地。世界奢华汽车品牌捷豹自诞生之初就深受英国皇室的推崇，从伊丽莎白女王到查尔斯王子等皇室贵族无不对捷豹青睐有加，捷豹更是威廉王子大婚的御用座驾，尽显皇家风范。1989年，捷豹被美国福特汽车公司并购，2008年3月26日，福特又把捷豹连同路虎(Landrover)售予印度塔塔汽车公司。自2','0','http://www.27270.com/word/chebiao/2015/8049.html','');");
E_D("replace into `www_92game_net_ecms_news` values('77','6','0','0','0','0','','77','1','admin','0','0','1','0','0','0','0','1475430947','1475430947','1','0','0','','/word/chebiao/77.html','1','1','1','','阿尔法罗密欧','1475429522','/d/file/titlepic/2016/10/03/0kcpw5ivqxd.jpg','','　　阿尔法·罗密欧(Alfa Romeo)是意大利著名的轿车和跑车制造商，创建于1910年，总部设在米兰。公司原名ALFA(Anonima Lombarda Fabbrica Automobili，伦巴第汽车制造厂)，其前身最早可追溯至1907年由Alessandre Darracq在米兰创建的一个汽车公司。1916年，出身那不勒斯的尼古拉·罗密欧(Nicola Romeo)入主该车厂，并将自己的家族姓氏融入到车厂名称中，从而成为今日的阿尔法·罗密欧。1986年公司被菲亚特集团(FIAT)收购。','0','http://www.27270.com/word/chebiao/2015/8011.html','');");
E_D("replace into `www_92game_net_ecms_news` values('78','6','0','0','0','0','','78','1','admin','0','0','1','0','0','0','0','1475430949','1475430949','1','0','0','','/word/chebiao/78.html','1','1','1','','路虎','1475429523','/d/file/titlepic/2016/10/03/gvmbtgys1tu.jpg','','　　路虎(Landrover)，路虎公司是世界上生产四驱车的公司之一，也是著名的英国越野车品牌。路虎(Landrover)，曾在中国大陆翻译成“陆虎”(香港地区称之为“越野路华”)，在“Landrover”未正式在中国销售前，国人一直翻译成“陆虎”，“Landrover”正式进入中国上市时，发现“陆虎”两个字已被国内一家汽车企业抢注商标，“Landrover”在中国注册为“路虎”。2003年，路虎公司在中国设立办事处。2009年，路虎已先后将旗下2010年款路虎揽胜(Range Rover)、路虎揽胜运动','0','http://www.27270.com/word/chebiao/2015/8050.html','');");
E_D("replace into `www_92game_net_ecms_news` values('79','6','0','0','0','0','','79','1','admin','0','0','1','0','0','0','0','1475430949','1475430949','1','0','0','','/word/chebiao/79.html','1','1','1','','菲亚特','1475429523','/d/file/titlepic/2016/10/03/0ifmtvjrnay.jpg','','　　菲亚特汽车公司(Fabbrica Italiana Automobili Torino，缩写即F.I.A.T.)，意大利著名汽车制造公司，世界十大汽车公司之一，成立于1899年，总部位于意大利工业中心，皮埃蒙特大区首府都灵。菲亚特作为超过百年历史的经典品牌一直被视为完美汽车的缔造者，旗下的著名品牌包括：包括菲亚特、克莱斯勒、Jeep、道奇、法拉利、玛莎拉蒂、阿尔法·罗密欧、蓝旗亚、道奇RAM、SRT、ABARTH、纽荷兰、FIAT PROFESSIONAL等。<br />\n\n　　1999年4月，南京菲','0','http://www.27270.com/word/chebiao/2015/8012.html','');");
E_D("replace into `www_92game_net_ecms_news` values('80','6','0','0','0','0','','80','1','admin','0','0','1','0','0','0','0','1475430950','1475430950','1','0','0','','/word/chebiao/80.html','1','1','1','','劳斯莱斯','1475429524','/d/file/titlepic/2016/10/03/ezq5pbnhura.jpg','','　　劳斯莱斯(Rolls-Royce)是世界顶级超豪华轿车厂商，1906年成立于英国，公司创始人为Frederick Henry Royce(亨利·莱斯)和Charles Stewart Rolls(查理·劳斯)。Rolls-Royce出产的轿车是顶级汽车的杰出代表，以豪华而享誉全球。<br />\n\n　　除了制造汽车，劳斯莱斯还涉足飞机发动机制造领域，它也是世界上最优秀的发动机制造者，著名的波音客机用的就是劳斯莱斯的发动机。2003年劳斯莱斯汽车公司被宝马(BMW)接手。','0','http://www.27270.com/word/chebiao/2015/7711.html','');");
E_D("replace into `www_92game_net_ecms_news` values('81','6','0','0','0','0','','81','1','admin','0','0','1','0','0','0','0','1475430950','1475430950','1','0','0','','/word/chebiao/81.html','1','1','1','','兰博基尼','1475429524','/d/file/titlepic/2016/10/03/1rdxe52lwvw.jpg','','　　兰博基尼(Automobili Lamborghini S.p.A.)(粤港地区称之为林宝坚尼，台湾地区则将其译为蓝宝坚尼或蓝宝基尼)全球顶级跑车制造商及欧洲奢侈品标志之一，公司坐落于意大利圣亚加塔·波隆尼(Sant\\\\''Agata Bolognese)，由费鲁吉欧·兰博基尼在1963年创立。早期由于经营不善，于1980年破产;数次易主后，1998年归入奥迪旗下，现为大众集团(Volkswagen Group)旗下品牌之一。<br />\n\n　　兰博基尼的标志是一头充满力量、正向对方攻击的斗牛，与大马力高','0','http://www.27270.com/word/chebiao/2015/8041.html','');");
E_D("replace into `www_92game_net_ecms_news` values('82','6','0','0','0','0','','82','1','admin','0','0','1','0','0','0','0','1475430951','1475430951','1','0','0','','/word/chebiao/82.html','1','1','1','','MG','1475429525','/d/file/titlepic/2016/10/03/wb3rc2o4ve0.jpg','','　　MG(MORRIS GARAGE)成立于1924年，是英国汽车品牌，主要生产敞篷跑车。','0','http://www.27270.com/word/chebiao/2015/7961.html','');");
E_D("replace into `www_92game_net_ecms_news` values('83','6','0','0','0','0','','83','1','admin','0','0','1','0','0','0','0','1475430952','1475430952','1','0','0','','/word/chebiao/83.html','1','1','1','','玛莎拉蒂','1475429525','/d/file/titlepic/2016/10/03/rw0wlumje0e.jpg','','　　玛莎拉蒂(Maserati)是一家意大利豪华汽车制造商，1914年12月1日成立于博洛尼亚(Bologna)，公司总部现设于摩德纳(Modena)，品牌的标志为一支三叉戟。1993年菲亚特(Fiat S.p.A.)收购玛莎拉蒂，但品牌得以保留。<br />\n\n　　玛莎拉蒂曾经是法拉利(一家菲亚特拥有大部分股权的公司)的一部分，现为菲亚特克莱斯勒汽车直接拥有。而今的玛莎拉蒂全新轿跑系列是意大利顶尖轿跑车制作技术的体现，也是意大利设计美学以及优质工匠设计思维的完美结合。','0','http://www.27270.com/word/chebiao/2015/8042.html','');");
E_D("replace into `www_92game_net_ecms_news` values('84','6','0','0','0','0','','84','1','admin','0','0','1','0','0','0','0','1475430953','1475430953','1','0','0','','/word/chebiao/84.html','1','1','1','','路特斯','1475429526','/d/file/titlepic/2016/10/03/bhygbzcoor4.jpg','','　　路特斯(Lotus Cars，曾被译为“莲花汽车”)是世界著名的跑车与赛车生产商，总部设在英国诺福克郡(Norfolk)的Hethel，由柯林·查普曼(Colin Chapman)创立于1952年，旗下的跑车以纯粹的驾驶乐趣和轻量化的设计而著称。1996年，Lotus被马来西亚汽车制造商宝腾(Proton)收购，2011年6月，Lotus品牌正式进入中国，并发布其中文官方名称“路特斯”。2014年1月24日，路特斯通过官方Twitter账号释放一张新车E22的3D照片。','0','http://www.27270.com/word/chebiao/2015/8051.html','');");
E_D("replace into `www_92game_net_ecms_news` values('85','6','0','0','0','0','','85','1','admin','0','0','1','0','0','0','0','1475430954','1475430954','1','0','0','','/word/chebiao/85.html','1','1','1','','法拉利','1475429525','/d/file/titlepic/2016/10/03/zsborcwmxib.jpg','','　　法拉利(Ferrari)是一家意大利汽车生产商，1929年由恩佐·法拉利(Enzo Ferrari)创办，主要制造一级方程式赛车、赛车及高性能跑车。法拉利是世界闻名的赛车和运动跑车的生产厂家，早期的法拉利赞助赛车手及生产赛车，1947年独立生产汽车。菲亚特(FIAT)拥有法拉利90%的股权，但法拉利却能独立于菲亚特运营。法拉利汽车大部分采用手工制造，产量很低，截至2011年法拉利共交付7195台新车，为法拉利史上最佳销售业绩。公司总部在意大利的马拉内罗(Maranello)。','0','http://www.27270.com/word/chebiao/2015/8048.html','');");
E_D("replace into `www_92game_net_ecms_news` values('86','6','0','0','0','0','','86','1','admin','0','0','1','0','0','0','0','1475430955','1475430955','1','0','0','','/word/chebiao/86.html','1','1','1','','风神','1475429527','/d/file/titlepic/2016/10/03/qr4gjgvc3nt.jpg','','　　风神汽车有限公司成立于2000年3月，是由东风汽车公司和台湾裕隆汽车制造股份有限公司合资建设的乘用车生产和经营的大型企业。合资比例为：东风汽车公司60%，台湾裕隆公司40%。东风汽车公司是国家明确重点支持的三大汽车集团之一。台湾裕隆集团是台湾第一大汽车制造厂，其市场占有率高达51%，年销售量20万辆。','0','http://www.27270.com/word/chebiao/2015/7753.html','');");
E_D("replace into `www_92game_net_ecms_news` values('87','6','0','0','0','0','','87','1','admin','0','0','1','0','0','0','0','1475430956','1475430956','1','0','0','','/word/chebiao/87.html','1','1','1','','帕加尼','1475429526','/d/file/titlepic/2016/10/03/sm40zxt5mmh.jpg','','　　帕加尼(Pagani Automobili S.p.A.)是一家世界知名的超级跑车制造商，公司创始人为奥拉西欧·帕加尼(Horacio Pagani)。与大名鼎鼎的法拉利一样，诞生于素有超跑之乡美誉的意大利小镇摩德纳(Modena)。帕加尼所生产的超级跑车以极致的性能、大量采用纯手工打造的精湛工艺、昂贵的售价以及订单生产的稀有产量闻名于世。旗下代表车系有：1999年正式发布的帕加尼Zonda、2011年推出的第二个全新车系帕加尼Huayra。','0','http://www.27270.com/word/chebiao/2015/8043.html','');");
E_D("replace into `www_92game_net_ecms_news` values('88','6','0','0','0','0','','88','1','admin','0','0','1','0','0','0','0','1475430956','1475430956','1','0','0','','/word/chebiao/88.html','1','1','1','','福迪','1475429528','/d/file/titlepic/2016/10/03/4msd1izmsqf.jpg','','　　福迪成立于1988年，是中国汽车品牌，主要生产SUV和皮卡车。','0','http://www.27270.com/word/chebiao/2015/7755.html','');");
E_D("replace into `www_92game_net_ecms_news` values('89','6','0','0','0','0','','89','1','admin','0','0','1','0','0','0','0','1475430957','1475430957','1','0','0','','/word/chebiao/89.html','1','1','1','','阿斯顿马丁','1475429527','/d/file/titlepic/2016/10/03/h14akiysfxi.jpg','','　　阿斯顿·马丁(AstonMartin)公司设在英国盖顿，生产敞篷旅行车、赛车和限量生产的跑车。建于1913年，创始人是莱昂内尔·马丁和罗伯特·班。<br />\n\n　　1987年被美国福特公司收购。2007年，Prodrive老板大卫·理查兹以9.25亿美元的价格从福特手中购得阿斯顿·马丁。<br />\n\n　　阿斯顿·马丁汽车标志为一只展翅飞翔的大鹏，喻示该公司像大鹏鸟一样，具有从天而降的冲刺速度和远大的志向。分别注有阿斯顿、马丁英文字样表明是一家“三结义”汽车公司。','0','http://www.27270.com/word/chebiao/2015/8044.html','');");
E_D("replace into `www_92game_net_ecms_news` values('90','6','0','0','0','0','','90','1','admin','0','0','1','0','0','0','0','1475430958','1475430958','1','0','0','','/word/chebiao/90.html','1','1','1','','广汽','1475429529','/d/file/titlepic/2016/10/03/jcaznxn0hcb.jpg','','　　广州汽车工业集团有限公司、万向集团公司、中国机械工业集团公司、广州钢铁企业集团有限公司、广州市长隆酒店有限公司五家公司以发起设立的方式，把广州汽车集团有限公司整体变改为广汽集团。2005年6月28日，广州汽车集团股份有限公司(简称广汽集团)成立。\n','0','http://www.27270.com/word/chebiao/2015/7757.html','');");
E_D("replace into `www_92game_net_ecms_news` values('91','6','0','0','0','0','','91','1','admin','0','0','1','0','0','0','0','1475430960','1475430960','1','0','0','','/word/chebiao/91.html','1','1','1','','哈飞','1475429531','/d/file/titlepic/2016/10/03/kuw4mufleri.jpg','','　　哈飞成立于2006年，是中国汽车品牌，主要生产微车、SUV、家用轿车等。','0','http://www.27270.com/word/chebiao/2015/7760.html','');");
E_D("replace into `www_92game_net_ecms_news` values('92','6','0','0','0','0','','92','1','admin','0','0','1','0','0','0','0','1475430961','1475430961','1','0','0','','/word/chebiao/92.html','1','1','1','','吉林汽车','1475429531','/d/file/titlepic/2016/10/03/aoeirkxmcqn.jpg','','　　一汽吉林汽车有限公司是中国第一汽车集团公司的全资子公司，是一汽集团的小型乘用车、商务用车生产基地。2005年10月，与日本大发签署技术许可协议，引进大发小型乘用车产品。','0','http://www.27270.com/word/chebiao/2015/7804.html','');");
E_D("replace into `www_92game_net_ecms_news` values('93','6','0','0','0','0','','93','1','admin','0','0','1','0','0','0','0','1475430961','1475430961','1','0','0','','/word/chebiao/93.html','1','1','1','','莲花','1475429532','/d/file/titlepic/2016/10/03/mte1mxkhava.jpg','','　　莲花成立于1951年，是中国汽车品牌，主要生产商用车、乘用车。','0','http://www.27270.com/word/chebiao/2015/7870.html','');");
E_D("replace into `www_92game_net_ecms_news` values('94','6','0','0','0','0','','94','1','admin','0','0','1','0','0','0','0','1475430962','1475430962','1','0','0','','/word/chebiao/94.html','1','1','1','','海马','1475429532','/d/file/titlepic/2016/10/03/etlujqnexfg.jpg','','　　1988年，海马建厂于海南省海口市。开始了第一次创业。1998到2005的第二次创业中，海马与战略伙伴合作，走出了一条“开放、合作、学习、发展”的路子， 海马夯实了自我发展的基础。从2006年起，海马人开始了第三次创业。今天，海马已经拥有两个整车工厂，一个年产15万台的发动机工厂。更重要的是海马拥有了一批成熟的汽车产业人才队伍，拥有了自主的整车研发能力，拥有了自主的销售服务网络，自主的供应配套体系，拥有了超过30万用户的品牌信赖，拥有了自我生存，自我发展，以我为主去实现海马梦想的体系能力。<br />','0','http://www.27270.com/word/chebiao/2015/7762.html','');");
E_D("replace into `www_92game_net_ecms_news` values('95','6','0','0','0','0','','95','1','admin','0','0','1','0','0','0','0','1475430962','1475430962','1','0','0','','/word/chebiao/95.html','1','1','1','','江淮','1475429532','/d/file/titlepic/2016/10/03/gpprfprwela.jpg','','　　安徽江淮汽车股份有限公司1999年9月30日成立，前身为合肥江淮汽车制造厂，公司占地面积460多万平方米，总资产53亿元，员工总数17000余人 。公司于2001年在上海证券交易所上市，股票名称为“江淮汽车”，股票代码600418，2004年又成功发行了可转债，2005年成功实施了股权分置改革。2011年，公司销售各类汽车超过46万辆，实现了连续21年以平均增长速度达40%的超快发展。','0','http://www.27270.com/word/chebiao/2015/7805.html','');");
E_D("replace into `www_92game_net_ecms_news` values('96','6','0','0','0','0','','96','1','admin','0','0','1','0','0','0','0','1475430963','1475430963','1','0','0','','/word/chebiao/96.html','1','1','1','','纳智捷','1475429533','/d/file/titlepic/2016/10/03/qzmbajacglo.jpg','','　　纳智捷(Luxgen)(杭州)汽车有限公司，是台湾最大的汽车企业裕隆集团与大陆合资成立之公司。纳智捷定位于“自主品牌，创新科技，后发先制，引领世界”，将生产车种为「豪华」、「智能」兼具的人性化智能车，车款包括MPV(厢式休旅车)、SUV(运动休旅车)与小型轿车等。台湾裕隆集团成立于1951年，是台湾十大财团之一，旗下在台湾拥有10家上市公司，是台湾举足轻重的大型集团，该集团主要从事汽车、纺织、铸造、房地产等业务，所属公司包括裕隆汽车、中华汽车、友联车材、华擎机械、台元纺织、台文针织、裕器工业、中华台亚','0','http://www.27270.com/word/chebiao/2015/7871.html','');");
E_D("replace into `www_92game_net_ecms_news` values('97','6','0','0','0','0','','97','1','admin','0','0','1','0','0','0','0','1475430963','1475430963','1','0','0','','/word/chebiao/97.html','1','1','1','','郑州海马','1475429533','/d/file/titlepic/2016/10/03/nvgqjqnme5f.jpg','','　　海马(郑州)汽车有限公司成立于2007年7月17日，是海马股份的全资子公司，主要从事微型乘用车、商用车的研发、生产、销售、服务等业务。经过三年的建设和开发，现已初具规模。已建成上海研发中心、第一工厂(年产5万辆微客)、第二工厂(年产15万辆轿车)、开封零部件工业园(11家配套厂);在建项目有年产30万台发动机项目、海马郑州技术中心项目、海马郑州零部件仓储配送中心项目、电动车试制试验和生产基地、郑州零部件工业园(一期)项目、生活配套设施项目。','0','http://www.27270.com/word/chebiao/2015/7768.html','');");
E_D("replace into `www_92game_net_ecms_news` values('98','6','0','0','0','0','','98','1','admin','0','0','1','0','0','0','0','1475430964','1475430964','1','0','0','','/word/chebiao/98.html','1','1','1','','江铃','1475429534','/d/file/titlepic/2016/10/03/r10pzjzxemd.jpg','','　　江铃创立于1968年，是中国汽车品牌，主要生产轻卡、轿车等车型。','0','http://www.27270.com/word/chebiao/2015/7807.html','');");
E_D("replace into `www_92game_net_ecms_news` values('99','6','0','0','0','0','','99','1','admin','0','0','1','0','0','0','0','1475430964','1475430964','1','0','0','','/word/chebiao/99.html','1','1','1','','南汽','1475429533','/d/file/titlepic/2016/10/03/cjv5gg341vh.jpg','','　　南汽集团是由国家经贸委批准，以跃进汽车集团公司(原南京汽车制造厂)为母公司的国家大型企业集团。集团主要产品包括轿车、轻型载货车、轻型客车、越野车、小型客货车、特种车、专用车等400多个品种及各类底盘等宽系列、多品种的产品组合，形成了南汽跃进、南京依维柯、南京菲亚特、南汽新雅途四大整车生产基地。','0','http://www.27270.com/word/chebiao/2015/7873.html','');");
