E_D("replace into `www_92game_net_ecms_news` values('101','6','0','0','0','0','','101','1','admin','0','0','1','0','0','0','0','1475430965','1475430965','1','0','0','','/word/chebiao/101.html','1','1','1','','江南','1475429534','/d/file/titlepic/2016/10/03/4xz0b1gn5ze.jpg','','　　江南汽车成立于1980年，是中国汽车品牌，主要生产客车、货车。','0','http://www.27270.com/word/chebiao/2015/7812.html','');");
