E_D("replace into `www_92game_net_ecms_news` values('105','6','0','0','0','0','','105','1','admin','0','0','1','0','0','0','0','1475430967','1475430967','1','0','0','','/word/chebiao/105.html','1','1','1','','启辰','1475429535','/d/file/titlepic/2016/10/03/agso2e3rjzs.jpg','','　　中文名：启辰，即启明星，开启光明的第一道辉芒，指引未来方向。<br />\n\n　　英文名：Venucia，源于希腊文，本意启明星。<br />\n\n　　寓意：它承载着“启辰”的梦想，以企业使命为源头，秉承尊重的信念，至善践行，以世界级先进技术，为中国主流消费者开启愉悦高品质汽车生活的品牌梦想。','0','http://www.27270.com/word/chebiao/2015/7878.html','');");
