E_D("replace into `www_92game_net_ecms_news` values('114','6','0','0','0','0','','114','1','admin','0','0','1','0','0','0','0','1475430972','1475430972','1','0','0','','/word/chebiao/114.html','1','1','1','','荣威','1475429539','/d/file/titlepic/2016/10/03/kmt4ao1bzld.jpg','','　　荣威(ROEWE)是上海汽车工业(集团)总公司旗下的一款汽车品牌，于2006年10月推出。该品牌下的汽车技术来源于上海汽车之前收购的罗孚，但上海汽车并未收购“罗孚”品牌。2006年10月12日，上海汽车(集团)股份有限公司(以下简称“上海汽车股份”)正式对外宣布，其自主品牌定名为“荣威(ROEWE)”，取意“创新殊荣、威仪四海”。荣威的品牌在4年时间里面发展迅速，其产品已经覆盖中级车与中高级车市场，“科技化”已经成为荣威汽车的品牌标签。荣威品牌口号为“品位科技 知你知行”。','0','http://www.27270.com/word/chebiao/2015/7906.html','');");
E_D("replace into `www_92game_net_ecms_news` values('115','6','0','0','0','0','','115','1','admin','0','0','1','0','0','0','0','1475430973','1475430973','1','0','0','','/word/chebiao/115.html','1','1','1','','汇众','1475429538','/d/file/titlepic/2016/10/03/00mcjzbjiq3.jpg','','　　汇众创立于1992年1月11日，是中国汽车品牌，主要生产自卸车、牵引车、揽拌车和货车等。','0','http://www.27270.com/word/chebiao/2015/7799.html','');");
E_D("replace into `www_92game_net_ecms_news` values('116','6','0','0','0','0','','116','1','admin','0','0','1','0','0','0','0','1475430973','1475430973','1','0','0','','/word/chebiao/116.html','1','1','1','','理念','1475429539','/d/file/titlepic/2016/10/03/2d2rpbcskej.jpg','','　　理念是广州汽车集团公司推出的一个自主品牌。2008年4月北京国际车展，在股东、政府、媒体的见证下，广汽本田自主品牌——理念(Everus)正式诞生，并发布了首款彰显时尚动感品牌主张的概念车。<br />\n\n　　理念(EVERUS)作为广汽本田旗下的两大品牌之一，其品牌产品将享有与广汽本田现有产品相同的技术、品质和服务，即“技术同步、品质同源、服务同网”。它的许多零部件都将会依据中国消费者需求进行开发，并完全按照广汽本田的技术标准及要求开发国内的供应商，确保机能性方面的零部件品质实现和广汽本田一致性。<','0','http://www.27270.com/word/chebiao/2015/7824.html','');");
E_D("replace into `www_92game_net_ecms_news` values('117','6','0','0','0','0','','117','1','admin','0','0','1','0','0','0','0','1475430974','1475430974','1','0','0','','/word/chebiao/117.html','1','1','1','','瑞麒','1475429540','/d/file/titlepic/2016/10/03/opgng054w0m.jpg','','　　瑞麒是奇瑞十二年在研发，技术，生产，管理等各方面积累的结果呈现，肩负着奇瑞向中高端市场进军，与各大著名全球品牌和合资品牌竞争的重任。其标志传达出蜕变、超越的向上理念。代表车型为瑞麒G5。2012年，奇瑞汽车战略结构调整，宣布逐渐停用瑞麒和威麟两个子品牌。','0','http://www.27270.com/word/chebiao/2015/7908.html','');");
